const KotlinTest = ({value, html, lastJsonMessage, handleHtmlChange}) => {

    return (
      <>
      <textarea>{lastJsonMessage?.data.editorContent}</textarea>
        <KotlinPlayground mode="kotlin" targetPlatform='js' onChange={handleHtmlChange}>
        <pre>
          <code>
            {value}
          </code>
        </pre>
      </KotlinPlayground>
      </>
    )
}

export default KotlinTest;
